VOID saveImageDataToTxt(const Image *image, const char *filename)
{
    FILE *file = fopen(filename, "w");
    if (file == NULL)
    {
        printf("\n -- Cannot Open %s -- \n", filename);
        return;
    }

    for (int i = 0; i < image->Height; i++)
    {
        for (int j = 0; j < image->Width; j++)
        {
            fprintf(file, "%d", image->data[i][j]);
            if (i != image->Height - 1 || j != image->Width - 1)
                fprintf(file, ",");
        }
    }

    fclose(file);
}
VOID saveImageIscheckToTxt(const Image *image, const char *filename)
{
    FILE *file = fopen(filename, "w");
    if (file == NULL)
    {
        printf("\n -- Cannot Open %s -- \n", filename);
        return;
    }

    for (int i = 0; i < image->Height; i++)
    {
        for (int j = 0; j < image->Width; j++)
        {
            UINT8 gray = (image->isCheck[i][j] == 0) ? 255 : 0;
            fprintf(file, "%d", gray);
            if (i != image->Height - 1 || j != image->Width - 1)
                fprintf(file, ",");
        }
    }

    fclose(file);
}
void drawRedCircle(Image *image, int x, int y, int radius) {
    int i, j;

    for (i = x - radius; i <= x + radius; i++) {
        for (j = y - radius; j <= y + radius; j++) {
            if (i >= 0 && i < MaxWidth && j >=   0 && j < MaxHeight) {
                int dx = i - x;
                int dy = j - y;
                double distance = sqrt(dx * dx + dy * dy);
                if (distance <= (radius) && distance >= (radius-1)) {
                    int index = j * MaxWidth + i;
                    image->data[i][j] = 255;  // Đặt giá trị mức xám là 255 (màu đỏ)
                }
            }
        }
    }
}
void _drawRedCircle(Image *image, int x, int y, int radius, float direction) {
    int i, j;

    for (i = y - radius; i <= y + radius; i++) {
        for (j = x - radius; j <= x + radius; j++) {
            if (i >= 0 && i < MaxWidth && j >=   0 && j < MaxHeight) {
                int dx = j - x;
                int dy = i - y;
                double distance = sqrt(dx * dx + dy * dy);
                if (distance <= (radius) && distance >= (radius-1)) {
                    int index = j * MaxWidth + i;
                    image->data[i][j] = 255;  // Đặt giá trị mức xám là 255 (màu đỏ)
                }
            }
        }
    }
    float sinn = sin(direction);
    float coss = cos(direction);
    for(int i = 0; i< 8; i++){
        int _y = round(y + i*sinn);
        int _x = round(x + i*coss);
        image->data[_y][_x] = 255;
    }
}
